@Service
public class DispatcherBusinessServiceImpl {
	Logger logger = Logger.getLogger(this.getClass());
	SimpleDateFormat sf = new SimpleDateFormat("yyyyMMddHHmmss");
	
	final String ACTION_BINDING = "binding";
	final String ACTION_CALLBACK = "callback";
	final String ACTION_DOWNLOADPROGRESS = "downloadProgress";
	final String ACTION_SYNCRESOURCES = "syncResources";
	
	@Resource
	MqttBroker mqttBroker;
	@Resource
	TerminalDAO terminalDAO;
	@Resource
	SurveillanceDAO surveillanceDAO;
	
	@Autowired
	SysUserService sysUserService;
	@Autowired
	TerminalService terminalService;
	@Autowired
	PublishTerminalService publishTerminalService;
	@Autowired
	PowerResourceService powerResourceService;
	
	@Resource
	MessageDAO messageDAQ;
	
	public void dispatcher(String topic, MqttMessage message)throws Exception{
		String tempTopic = null;

		try {
			if(StringUtil.isEmpty(topic)){
				//主题为空
				mqttBroker.publish(topic, message.getQos(), err(0, 1).getBytes(Charset.forName(Constants.ENCODING)));
				return;
			}
			//根据主题转发
			String[] topics = topic.split(Constants.TOPIC_SEPARATOR);
			if(topics.length == 1){
				return;  //心跳不用处理
			}

			if(topic.length()<=2){
				//主题格式不正确
				mqttBroker.publish(topic, message.getQos(), err(0, 2).getBytes(Charset.forName(Constants.ENCODING)));
				return;
			}
			
			if(logger.isDebugEnabled()){
				logger.debug("--------------*****************-------------------> DispatcherBusinessServiceImpl topic: "+topic);
			}

			// cloudringAd/server/web/869c714783334d8394661c36d70f0cf8/out
			// cloudringAd/server/web/terminalId/out      cloudringAd/server/terminal/userId/out
			if("server".equals(topics[1])){
				//web发给mqtt服务器的数据
				if(Constants.TOPIC_WEB.equals(topics[2])){
					tempTopic = "cloudringAd/client/terminal/"+topics[3]+"/in";
					if(logger.isDebugEnabled()){
						logger.debug("----------------web发给mqtt服务器的数据: "+tempTopic +" -----------------");
					}
					mqttBroker.publish(tempTopic, message.getQos(), message.getPayload());
					if(logger.isDebugEnabled()){
						logger.debug("----------------web发给mqtt服务器的数据完成-----------------");
					}
				}
				//终端发给mqtt服务器的数据
				else if(Constants.TOPIC_TERMINAL.equals(topics[2])){
					String info = new String(message.getPayload(), Constants.ENCODING);
					if(StringUtil.isEmpty(info)){
						return;
					}
					
					//用alibaba的json包来处理json串
					JSONObject jsonOject = (JSONObject)JSON.parse(info);
					String action = jsonOject.getString(Constants.JSON_KEY_NAME_ACTION);
					
					//终端信息绑定(已经走http协议了，)
					if(action != null && ACTION_BINDING.equals(action.trim())){
						Terminal terminal = JSON.parseObject(info, Terminal.class);
						if(terminal != null){
							terminal.setStatus(Constants.TERMINAL_ONLINE_IN);
							SysUserVO vo = sysUserService.getInfoById(terminal.getUserId());
							terminal.setMechanism(vo.getDepartmentid());
							
							terminalService.save(terminal);
						}
					}
					
					//信息回传
					else if(action != null && ACTION_CALLBACK.equals(action.trim())){
						Message _message = JSON.parseObject(info, Message.class);
						if(_message != null){
							if(Constants.MESSAGE_TYPE_IMAGES.equals(_message.getType()) 
									|| Constants.MESSAGE_TYPE_VIDEO.equals(_message.getType())){
								//生成附件
								byte[] hexBytes = hexStr2Str(_message.getContent());
								String path = Constants.CLOUD_CALLBACK_FILE+File.separator+Constants.CLOUD_IMAGE_FILE;
								String imageUrl = IOStreamUtils.saveInputStreamImageToFolder(path, _message.getName(), hexBytes);
								
								_message.setContent(imageUrl);
							}
							
							messageDAQ.save(_message);
						}
					}
					//下载进度回传
					else if(action != null && ACTION_DOWNLOADPROGRESS.equals(action.trim())){
						PublishTerminal pt=new PublishTerminal();
						pt.setTermianl_id(jsonOject.getString(Constants.JSON_KEY_TERMINALID));
						pt.setProgram_id(jsonOject.getString(Constants.JSON_KEY_PROGRAMID));
						PublishTerminal publishTerminal=publishTerminalService.getByTerminalId(pt);
						String starTime=jsonOject.getString(Constants.JSON_KEY_STARTTIME);
						if("".equals(starTime)){
							if(publishTerminal.getReception_time()==null){
								Date now=new Date();
								publishTerminal.setReception_time(now);
							}
						}else{
							publishTerminal.setReception_time(sf.parse(starTime));
						}
						String endTime=jsonOject.getString(Constants.JSON_KEY_ENDTIME);
						if("".equals(endTime)){
							publishTerminal.setComplete_time(null);
						}else{
							publishTerminal.setComplete_time(sf.parse(endTime));
						}
					   publishTerminal.setProgress(jsonOject.getString(Constants.JSON_KEY_PROGRESS));
					   publishTerminalService.update(publishTerminal);
						
					}
					//开机同步资源
					else if(action != null && ACTION_SYNCRESOURCES.equals(action.trim())){
						String terminalId = jsonOject.getString(Constants.JSON_KEY_TERMINALID);
						
						List<SurveillanceVO> surveillanceList = surveillanceDAO.getSurveillanceListByTerminalId(terminalId);
						
						Map<String, PowerProgramResourceVO> map = powerResourceService.getProgramByTerminalId(terminalId);
						Collection<PowerProgramResourceVO> valueCollection = map.values();
						List<PowerProgramResourceVO> programList = new ArrayList<PowerProgramResourceVO>(valueCollection);
						
						SyncResourcesVO syncResourcesVO = new SyncResourcesVO();
						syncResourcesVO.setAction(ACTION_SYNCRESOURCES);
						syncResourcesVO.setTerminalId(terminalId);
						syncResourcesVO.setErrno("0");
						syncResourcesVO.setTm(sf.format(new Date()));
						syncResourcesVO.setVmIpList(surveillanceList);
						syncResourcesVO.setProgramList(programList);
						
						String syncResourcesJson = JSONObject.toJSONString(syncResourcesVO);
						
						//发送mqtt消息
						tempTopic = "cloudringAd/client/terminal/"+terminalId+"/in";
						mqttBroker.publish(tempTopic, message.getQos(), syncResourcesJson.getBytes());
					}
				}
			}

			else if(topics.length == 3 && "keepalive".equals(topics[1])){
				//心跳，主要维持用户是否在线的状态 cloudringAd/keepalive/#
				Terminal terminal = new Terminal();
				terminal.setId(topics[2]);
				terminal.setStatus(Constants.TERMINAL_ONLINE_IN);
				terminal.setModifyDate(new Date());

				terminalDAO.update(terminal);
			}
			
		} catch (Exception e) {
			e.printStackTrace();
		}
	}
	
	private String err(int no, int errno){
		return "{\"no\": \""+no+"\",\"errno\": \""+errno+"\",\"tm\": \""+sf.format(new Date())+"\"}";
	}

	/** 
	 *  
	 * 十六进制转换二进制
	 */
	public static byte[] hexStr2Str(String hexStr) {  
	    String str = "0123456789ABCDEF";  
	    char[] hexs = hexStr.toCharArray();  
	    byte[] bytes = new byte[hexStr.length() / 2];  
	    int n;  
	    for (int i = 0; i < bytes.length; i++) {  
	        n = str.indexOf(hexs[2 * i]) * 16;  
	        n += str.indexOf(hexs[2 * i + 1]);  
	        bytes[i] = (byte) (n & 0xff);  
	    }  
	    return bytes;  
	}  

	public void test(String info) throws Exception{
		Message _message = JSON.parseObject(info, Message.class);
		if(_message != null){
			if(Constants.MESSAGE_TYPE_IMAGES.equals(_message.getType()) 
					|| Constants.MESSAGE_TYPE_VIDEO.equals(_message.getType())){
				//生成附件
				byte[] hexBytes = hexStr2Str(_message.getContent());
				String path = Constants.CLOUD_CALLBACK_FILE+File.separator+Constants.CLOUD_IMAGE_FILE;
				String imageUrl = IOStreamUtils.saveInputStreamImageToFolder(path, _message.getName(), hexBytes);
				
				_message.setContent(imageUrl);
			}
            
			System.out.println("over....");
		}
	}
	
	
	public static void main(String[] arg)throws Exception{
		String json = "{\"action\":\"callback\",\"type\":\"image\",\"name\":\"abc.jpg\",\"terminalId\":\"293b1e6ea6524386ae25509708535549\",\"content\":\"\",\"ip\":\"192.168.1.101\",\"createDate\":\"2016-03-28 12:14:12\"}";
	    
		DispatcherBusinessServiceImpl impl = new DispatcherBusinessServiceImpl();
		impl.test(json);
	
		System.out.println("success");
	}
	
}
